css:
@-moz-document url-prefix('https://www.google.') {

html[manifest] #lga:before,
.hp #lga:before {
  content: ""; position: absolute;
  width: 242px; height: 619px;
  left: calc(50% - 121px);
  background-size: auto 100%;
  background:
    url('data:image/png;base64,')
   no-repeat top center;
  z-index: -1;
}

#hplogo {
  width: 0; padding-left: 269px;
  background: url('data:image/png;base64,')
   bottom center no-repeat;
  background-size: 269px auto;
}

HTML[manifest],
BODY.hp {
   background: repeating-linear-gradient(to right,
   #f3eeeb 0px, #f3eeeb 18px,
   #efe8e2 18px, #efe8e2 34px,
   #f3eeeb 34px, #f3eeeb 48px,
   #efe8e2 48px, #efe8e2 64px
   );
}
HTML[manifest] > BODY {background: none !important}

/*[[doodles]]*/

}

style_setting_options.value:
/* keep the Google doodles */
/*.hp #lga[style]:before {
  top: 0px;
}*/
DIV#hplogo {
  padding-left: 0;
}

/* no Google doodles */
DIV#hplogo {
  height: 95px !important;
  margin-top: 112px;
}
DIV#hplogo * {
  display: none;
}
